webpackJsonp([0xe052217c1509],{5079:function(e,t){e.exports={data:{post:{html:'<p>Familie Berg describes <a href="http://familieberg.editthispage.com/stories/storyReader$213">Moritz Tagesablauf</a> (in German), the daily routine for the 8 month old Moritz. This all sounds very familiar (especially the part about changing the diaper when it smells suspicious).</p>\n<p>Mama keeps asking me what her plants are called in English. <a href="http://linnaeus.nrm.se/flora/">Den virtuella floran</a> is a multilingual botanical database from Sweden. Alas, the text is all in Swedish, but you can look up common names in a number of languages.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/crh0521.jpg" height="376" width="350" border="0" alt="crh0521.jpg: " /></p>\n<p>It took Christopher just 10 minutes to slide and roll his way the 2 meters from the corner under the teddy bear mobile to just behind Mama\'s desk. We thought it was pretty cute until he started tugging on Mama\'s mouse cable.</p>',fields:{title:"Kaiser roll",date:"21 May 2000",url:"https://papascott.de/2000-05-21-kaiser-roll/"}}},pathContext:{slug:"/2000-05-21-kaiser-roll/",prev:{fields:{title:"One of those days",date:"18 May 2000",slug:"/2000-05-18-one-of-those-days/"}},next:{fields:{title:"Phoenix one, Phoenix two",date:"22 May 2000",slug:"/2000-05-22-phoenix-one-phoenix-two/"}}}}}});
